import logo from './logo.svg';
import './App.css';
import { useState } from "react";

export default function LPSweepNotes(){
  const [floor1, setfloor1] = useState('');
  const floor1Change = (event) => {
    setfloor1(event.target.value);
  };

return (
  <form>
    <label>Floor 1
    <input type="text" value ={floor1} onChange={floor1Change}/>
    </label>
    <p>Floor 1: {floor1}</p>
  </form>
  )
};


